<!DOCTYPE html>
<html lang="en">

    <head>
        <title></title>
        <meta charset="UTF-8">
        <meta http-equiv="Content-Type" content="text/html; charset=UTF-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <link rel="manifest" href="manifest.json">
        <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Montserrat|Cabin:500" />
        <link rel="stylesheet" type="text/css" href="css/w3.css" />
        <link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.8.1/css/all.css" />
        <link rel="stylesheet" type="text/css" href="css/style.css" />
        <!-- Google Analytics -->
        <script>
            (function (i, s, o, g, r, a, m) {
                i['GoogleAnalyticsObject'] = r;
                i[r] = i[r] || function () {
                    (i[r].q = i[r].q || []).push(arguments)
                }, i[r].l = 1 * new Date();
                a = s.createElement(o),
                    m = s.getElementsByTagName(o)[0];
                a.async = 1;
                a.src = g;
                m.parentNode.insertBefore(a, m)
            })(window, document, 'script', 'https://www.google-analytics.com/analytics.js', 'ga');
            ga('create', "UA-96654872-1", 'auto');
            ga('send', 'pageview');
        </script>
        <!-- End Google Analytics -->
        <style>
            .w3-theme-dark {
                color: #fff !important;
                background-color: #282c37 !important
            }

            .w3-theme-action {
                color: #fff !important;
                background-color: #607d8b !important
            }

            .w3-text-theme {
                color: #282c37 !important
            }

            .w3-border-theme {
                border-color: #2b90d9 !important
            }

            .w3-hover-theme:hover {
                color: #fff !important;
                background-color: rgba(75, 75, 75, 0.5) !important
            }

            .w3-hover-text-theme:hover {
                color: #607d8b !important
            }

            .w3-hover-border-theme:hover {
                border-color: #2b90d9 !important
            }

            .w3-animate-opacity {
                animation: opac 1.6s !important
            }

            .w3-animate-top {
                animation: animatetop 1s !important
            }

            .w3-animate-left {
                animation: animateleft 1s !important
            }

            .w3-animate-right {
                animation: animateright 1s !important
            }

            .w3-animate-bottom {
                animation: animatebottom 1s !important
            }

            .w3-animate-zoom {
                animation: animatezoom 1.2s !important
            }

            .w3-animate-input {
                transition: width 1s ease-in-out !important
            }
        </style>
    </head>

    <!-- Start body -->

    <body id="scroll-pane" class="w3-blue-gray" style="overflow-x: hidden; overflow-y: auto; max-height: 100vh">
        <!-- Side Navigation -->
        <div id="sideBr" class="w3-theme-dark w3-hide w3-animate-left w3-sidebar w3-rightbar w3-mobile" style="top: 0">
            <div class="w3-bar-block w3-padding-small w3t15" style="margin: 0.5%">
                <button id="btnCls" class="w3-bar-item w3-btn far fa-hand-point-left w3-hover-teal w3-mobile"></button>
                <hr class="w3-2019-pepper-stem" style="margin: 1% 0">
                <button id="dlBtn" class="w3-bar-item w3-btn fas fa-cloud-download-alt w3-hover-indigo w3-mobile"></button>
                <button id="prntBtn" class="w3-bar-item w3-btn fa fa-print w3-hover-indigo w3-mobile"></button>
                <button id="ddcBtn" class="w3-bar-item w3-btn fas fa-external-link-alt w3-hover-indigo w3-hide-small"></button>
                <button id="optBtn" class="w3-bar-item w3-btn fab fa-whmcs w3-mobile w3-hover-teal w3-center" style="bottom: 0; position: absolute"></button>
            </div>
        </div>
        <!--Main -->
        <div id="main">
            <!-- Header -->
            <header id="pgHdr" class="w3-bar w3-padding-small w3-card-4 w3-theme-dark" role="banner" style="width: 100%; overflow: hidden; position: absolute; top: 0; height: auto">
                <div class="w3-bar-item w3-left" style="margin: 0 0 0.5em -1em; width: 15%">
                    <button id="openNav" class="w3-btn w3t15 fas fa-bars w3-left w3-hover-theme" style="padding: 0.5em; left: 0"></button>
                </div>
                <div id="hdrDiv" class="w3-bar-item w3-animate-zoom w3-center" style="margin: -2vh 0 0 -1vw; padding-bottom: 0; width: 70%">
                    <div id="hdrName" class="w3t3 w3-text-sand w3-nowrap w3-animate-top"></div>
                    <div id="subHdrNm" class="w3t1 w3-text-amber w3-text-shadow w3-nowrap w3-smallcaps w3-italic w3-animate-bottom" style="margin-top: -0.9em"></div>
                </div>
                <div id="srchBox" class=" w3-bar-item w3-hide" style="margin: 0 0.4em; padding: 0; width: 50%">
                    <input id="hdrSrch" class="w3-right w3-input w3t1 w3-hover-light-gray w3-text-black w3-bold w3-border w3-animate-input" type="text" maxlength="30" autocomplete="off" autocorrect="off" style="width: 50%" />
                    <button id="clrSrch" class="w3-button w3-light-grey w3-hover-text-pink w3t15 fas fa-eraser w3-hide"></button>
                </div>
                <div class="w3-bar-item w3-right" style="margin: 0 -0.5em 0; width:10%">
                    <button id="btnSrch" class="w3-right w3-btn w3t15 fas fa-search w3-hover-theme" style="padding: 0.125em"></button>
                </div>
            </header>
            <!-- Start Page -->
            <section id="docs-Section" class="w3-hide w3-content w3-card-4 w3-light-gray w3-animate-zoom" role="main" style="padding: 0.1em 0 0 1em" itemscope itemtype="http://schema.org/Person">
                <article id="hdrQual" class="w3-container">
                    <blockquote></blockquote>
                    <!-- Begin QUAL Tmpl -->
                    <template id='qual-tmpl'>
                        <div class="w3-row">
                            <div class="qualData"></div>
                        </div>
                    </template>
                    <!-- End SOFT Tmpl -->
                </article>
                <article id="hdrSoft" class="w3-container">
                    <blockquote></blockquote>
                    <!-- Begin Soft Tmpl -->
                    <template id='soft-tmpl'>
                        <div class="softData w3-third" data-hdr="1"></div>
                    </template>
                    <!-- End SHK Tmpl -->
                </article>
                <article id="hdrAccr" class="w3-container">
                    <blockquote></blockquote>
                    <div class="w3-row" itemscope itemtype='http://schema.org/EducationalOrganization' style="margin-left: 0">
                        <div class="w3-half m3-mobile w3-padding-small">
                            <div class="hdr7"></div>
                            <div class="hdr7"></div>
                            <div class="hdr7"></div>
                        </div>
                        <div class="w3-half w3-mobile w3-padding-small" style="padding-right: -1em">
                            <div class="hdr7"></div>
                            <div class="hdr7"></div>
                            <div class="hdr7"></div>
                            <div class="hdr7"></div>
                        </div>
                    </div>
                </article>
                <article id="hdrEmpl" class="w3-container">
                    <blockquote></blockquote>
                    <!-- Begin REH Tmpl -->
                    <template id='empl-tmpl'>
                        <div class='w3-row w3-bottombar w3-border-theme' style="margin-bottom: 0.25%">
                            <div class='emplData w3-row textHvr' itemscope itemtype='http://schema.org/Organization' style="margin-top: 1%">
                                <div class='jobinfo w3-bold w3-cell-row' itemscope itemtype="http://schema.org/Event">
                                    <div class="ttlcomp w3-cell w3t125 w3-left" style="width: 80%; padding-left: 0.5em">
                                        <div class='jobtitle' itemprop='jobTitle'></div>
                                        <div class='jobcomp w3-text-deep-orange w3-smallcaps w3-nowrap' itemprop='name'>
                                        </div>
                                    </div>
                                    <div class='w3-cell w3-display-container w3t1 w3-smallcaps' style="width: 20%">
                                        <div class="jobdate w3-text-deep-purple w3-display-topright w3-nowrap" style="margin-top: 0.313em"></div>
                                    </div>
                                </div>
                                <div class='empsum w3-text-green w3t085 w3-bold w3-italic' itemprop='description' style="margin-left: 1.5em; text-indent: 5%"></div>
                                <ul class="w3t1"></ul>
                            </div>
                        </div>
                    </template>
                    <!-- End REH Tmpl -->
                </article>
                <div id="hdrOthr" class="w3-container" style="margin: -3% 0 1% 1.5%">
                    <div id="othrHdr" class="w3t125 w3-bold w3-left w3-padding-small" style="margin-left: -1em"></div>
                    <div class="w3-row w3-center"></div>
                </div>
                <div id="caboose" class="w3t1 w3-center w3-padding-small w3-text-purple w3-bold" style="margin: 2% 0 -2%">
                </div>
                <br />
            </section>
            <!-- Footer -->
            <footer id="ftrPnl" class="w3-row w3-theme-dark w3-card-4 w3-padding-small" style="overflow: hidden; position: absolute; bottom: 0; width: 100%">
                <div id="cntctPnl" class="w3-hover-black w3-bar w3-card-4 w3-hide-medium w3-hide-large" style="margin: 0.5em -0.5em 0.5em 0; padding: 0.156em">
                    <i class=" w3-bar-item w3-left far fa-address-book w3t14 w3-text-amber"></i>
                    <div class="w3-bar-item w3t125 w3-text-shadow" style="margin: -0.156em 0 0 -1.75em">Contact Info</div>
                    <i id="chevBtn" class="w3-bar-item w3-button w3-hover-black fas fa-chevron-up w3-right w3-animate-left" style="margin-top: 0.156em"></i>
                </div>
                <div id="infoBlk" class="w3-hide-small w3-row w3-center w3-animate-top w3t125">
                    <button id="phoneNo" class="w3-btn w3-mobile">
                        <i class="fas fa-phone-square w3-text-shadow"></i>
                    </button>
                    <button id="emailAddr" class="w3-btn w3-mobile">
                        <i class="fas fa-envelope-open-text w3-text-khaki w3-text-shadow"></i>
                    </button>
                    <button id="webAddr" class="w3-btn w3-mobile">
                        <i class="fas fa-globe-americas w3-text-light-blue w3-text-shadow"></i>
                    </button>
                </div>
                <!-- Mobile Social Button Row-->
                <div id="mobSocBlk" class="w3-center w3-hide w3-animate-zoom"></div>
                <!-- Copyright row -->
                <div id="cpyRt" class=" w3-row w3-container w3-center w3t085 w3-hide-small" style="opacity: 0.75; position: absolute; bottom: 0; width: 100%">
                </div>
            </footer><!-- End footer -->
        </div>
        <!-- End main -->

        <!-- Button Up -->
        <button id="btnUp" class="w3-btn w3-ripple w3-2019-princess-blue w3-text-shadow2 fas fa-caret-up w3t2"></button>

        <!-- floating eles and modals -->
        <div id="mdlDlg" class="w3-modal">
            <div id="mdlEle" class="w3-modal-content w3-theme-dark w3-bottombar w3-card-4 w3-dragHdr">
                <header id='mdlHdr' class="w3-container w3-center w3-2019-bluestone">
                    <button id="mdlCls" class="w3-btn w3-2019-bluestone w3t1 w3-display-topright w3-text-shadow fas fa-times w3-hover-text-red" style="padding: 0; margin: 0.167em 0.5em; background-color: transparent"></button>
                </header>
                <div id="mdlLbl" class="w3-italic w3t1 w3-left  w3-padding-small"></div>
                <div id="fltyps" class="w3-bar w3-container w3t2 w3-theme-dark w3-center w3-padding-small"></div>
            </div>
        </div>

        <div id="mdlDlg1" class="w3-modal">
            <div id="mdlEle1" class="w3-modal-content w3-theme-dark w3-bottombar w3-card-4 w3-dragHdr" style="width: 25%">
                <header id='mdlHdr1' class="w3-container w3-center w3-text-amber w3-2019-bluestone w3t125 w3-text-shadow2">
                    <button id="mdlCls1" class="w3-btn w3-2019-bluestone w3t1 w3-display-topright w3-text-shadow fas fa-times w3-hover-text-red" style="padding: 0; margin: 0.313em; background-color: transparent"></button>
                </header>
                <div id="ddcnt" class="w3-smallcaps w3-bar-block w3t1"></div>
            </div>
        </div>
        <!-- Social Buttons widget -->
        <div id="socAncrs" class="w3-hide-small w3-hide-medium w3-animate-right w3-card-2" style="padding: 0.85em 0.5em 0.125em !important">
            <button id='togsoc' class="w3-bold w3t085 w3-btn w3-animate-left w3-border-bottom w3-border-deep-orange" style="padding: 0.2em 0.125em 0.05em">
                <i id='togsoci' class="w3-right fas fa-angle-double-right" style="margin-right: 9%"></i>
            </button>
            <div id="socBtns" class="w3-bar-block w3-center"></div>
        </div>
        <!-- framesize -->
        <div id="framesize" class="w3-hide w3-animate-left w3-dragHdr w3-panel w3-card-4 w3-yellow w3-rightbar w3-border-red w3-hover-border-white w3t1 w3-bold w3-bar-block">
            <div id="frmSz1" class="w3-bar-item w3t085">Width: </div>
            <div id="frmSz2" class="w3-bar-item w3t085">Height: </div>
            <div id="frmSz3" class="w3-bar-item w3t085">ScrollPos: </div>
        </div>
        <!-- Scripts -->
        <script src="https://cdn.jsdelivr.net/combine/npm/prefixfree@1,npm/jquery@3,npm/hammerjs@2,npm/lodash@4,npm/jquery.scrollto@2,npm/jquery.localscroll@2,npm/print-js-ice6@1"></script>
        <!--<script type="text/javascript" src="lib/data.js"></script>
        <script type="text/javascript" src="lib/script.js"></script>
        <script type="text/javascript" src="lib/misc.js"></script>-->
        <script type="text/javascript" src="min/lib.min.js"></script>
        <!-- End scripts -->
    </body>

</html>
